import React, { Component } from 'react';

class ShowList extends React.Component {

	constructor() {
		super();
		this.state = {
		  feeds: []
		};
	  }

	  render() {
		return (
		  <div className="form-group">
			{this.state.feeds}
		  </div>
		);
	  }
	}


export default ShowList;
